import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './context/AuthContext';
import "./index.css";

// Public pages
import Home from './pages/Home';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';

// Admin pages
import Dashboard from './pages/Dashboard';
import Tasks from './pages/Tasks';
import Projects from './pages/Projects';
import Chat from './pages/Chat';
import CreateTask from './pages/CreateTask';

// Student pages
import StudentDashboard from './pages/StudentDashboard';
import StudentTasks from './pages/StudentTasks';
import StudentProjects from './pages/StudentProjects';
import StudentChat from './pages/StudentChat';
import StudentNotifications from './pages/StudentNotifications';

// Protected components
import ProtectedRoute from './components/ProtectedRoute';

function App() {
  return (
    <AuthProvider>
      <Routes>
        {/* Public routes */}
        <Route path="/" element={<Home />} />
        <Route path="/signin" element={<SignIn />} />
        <Route path="/signup" element={<SignUp />} />

        {/* Admin routes */}
        <Route path="/dashboard" element={<ProtectedRoute role="admin"><Dashboard /></ProtectedRoute>} />
        <Route path="/dashboard/tasks" element={<ProtectedRoute role="admin"><Tasks /></ProtectedRoute>} />
        <Route path="/dashboard/projects" element={<ProtectedRoute role="admin"><Projects /></ProtectedRoute>} />
        <Route path="/dashboard/chat" element={<ProtectedRoute role="admin"><Chat /></ProtectedRoute>} />
        <Route path="/dashboard/tasks/create" element={<ProtectedRoute role="admin"><CreateTask /></ProtectedRoute>} />

        {/* Student routes */}
        <Route path="/student-dashboard" element={<ProtectedRoute role="student"><StudentDashboard /></ProtectedRoute>} />
        <Route path="/student-dashboard/tasks" element={<ProtectedRoute role="student"><StudentTasks /></ProtectedRoute>} />
        <Route path="/student-dashboard/projects" element={<ProtectedRoute role="student"><StudentProjects /></ProtectedRoute>} />
        <Route path="/student-dashboard/chat" element={<ProtectedRoute role="student"><StudentChat /></ProtectedRoute>} />
        <Route path="/student-dashboard/notifications" element={<ProtectedRoute role="student"><StudentNotifications /></ProtectedRoute>} />

        {/* Fallback route */}
        <Route path="*" element={<Navigate to="/" replace />} />
      </Routes>
    </AuthProvider>
  );
}

export default App;
